import React from 'react';
import {withTheme} from '@material-ui/core/styles';
import {connect} from "react-redux";

import Layout from "../components/_layouts/default/Layout";
import BoxList from "../components/HomePage/BoxList";
import {login, logout} from "../actions/AuthActions";

function HomePage(props) {
    const {images, userActions, userInfo} = props
    
    return (
        <Layout user={{userInfo, userActions}}>
            <BoxList images={images}/>
        </Layout>
    );
}

const mapStateToProps = (store) => {
    return {
        images: store.homePage.images,
        userInfo: store.user
    }
}

const mapDispatchToProps = (dispatch) => {
    return {
        userActions: {
            login: () => dispatch(login()),
            logout: () => dispatch(logout()),
        }
    }
}

export default connect(mapStateToProps, mapDispatchToProps)(
    withTheme(HomePage)
)
